import React, { useState, useEffect } from 'react'
import './styles.css'
import Gerenciador from '../Gerenciador'
import { MuiThemeProvider, createMuiTheme } from '@material-ui/core/styles'
import { CssBaseline, CircularProgress } from '@material-ui/core'
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom'
import firebase from '../firebase'
import Recurso from '../Gerenciador/Recurso';
const theme = createMuiTheme({
	typography: {
	  useNextVariants: true,
	},
	});


export default function App() {

	const [firebaseInitialized, setFirebaseInitialized] = useState(false)

	useEffect(() => {
		firebase.isInitialized().then(val => {
			setFirebaseInitialized(val)
		})
	})
	return firebaseInitialized !== false ? (
			<Router>
			<div>
			<Route exact path="/gerente"   render={(props) => <Gerente {...props} h1first='Alocação de Recursos' />}/>
              <Route path="/funcionario1" exact render={(props) => <Funcionário {...props} h1first='Reserva de Recursos' numero='01'/>} />
              <Route path="/funcionario2" exact render={(props) => <Funcionário {...props} h1first='Reserva de Recursos' numero='02'/>} />
              <Route path="/funcionario3" exact render={(props) => <Funcionário {...props} h1first='Reserva de Recursos' numero='03'/>} />
			</div>
			</Router>
	) : <div id="loader"><CircularProgress /></div>
}
